import { TextField } from "@mui/material";
import React, {useState, useEffect} from "react";

const initialFieldValues = {
  firstName : "",
  lastName: "",
  email: "",
  phonwNumber: ""
}

const ContactForm = (props) => {

  const [values, setValues] = useState(initialFieldValues);

  return (
    <form autoComplete="off" noValidate>
      <TextField
        name="firstName"
        variant="outlined"
        label="First Name"
        fullWidth
        value={values.firstName}
      />
      <TextField
        name="lastName"
        variant="outlined"
        label="Last Name"
        fullWidth
        value={values.lastName}
      />
      <TextField
        name="email"
        variant="outlined"
        label="Email"
        fullWidth
        value={values.email}
      />
      <TextField
        name="phoneNumber"
        variant="outlined"
        label="Phone Number"
        fullWidth
      />
    </form>
  );
}

export default ContactForm;
